html {
    height: 100%
}

.sr-only {
    position: absolute;
    overflow: hidden;
    clip: rect(0 0 0 0);
    width: 1px;
    height: 1px;
    margin: -1px;
    padding: 0;
    border: 0
}

.no-wrap {
    white-space: nowrap
}

.Select {
    position: unset !important
}

.Select-control,
.Select-menu-outer {
    border-radius: 0 !important
}

.Select-menu-outer {
    margin-top: 1px !important;
    left: -1px !important;
    width: 100.4% !important;
    top: inherit !important
}

.schedule-select .Select-clear {
    display: none !important
}

.Select-placeholder,
input[type=number]::-webkit-input-placeholder {
    font-style: italic
}

.schedule-select .Select-menu-outer {
    z-index: 2
}

input::-webkit-inner-spin-button,
input::-webkit-outer-spin-button {
    -webkit-appearance: none;
    margin: 0
}

.fit-content {
    height: -webkit-fit-content;
    height: -moz-fit-content;
    height: fit-content
}


